                            "attachment": {
                                "contentType": "text/html",
                                "content": "<p class=\"Pro\"><!--[if !supportLists]--><span style=\"font-size:20.0pt;mso-bidi-font-size:18.0pt;font-family:Wingdings;\nmso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings;color:green\">C<span style=\"font-size: 7pt; line-height: normal; font-family: 'Times New Roman';\"> </span></span><!--[endif]-->For\nrigorous analysis of knowledge, CMAP is hard to beat <span style=\"color:#5A5A5A\"><o:p></o:p></span></p>\n\n<p class=\"Con\"><!--[if !supportLists]--><span style=\"font-size:16.0pt;mso-bidi-font-size:18.0pt;font-family:&quot;Wingdings 2&quot;;\nmso-fareast-font-family:&quot;Wingdings 2&quot;;mso-bidi-font-family:&quot;Wingdings 2&quot;;\ncolor:#943634\">N<span style=\"font-size: 7pt; line-height: normal; font-family: 'Times New Roman';\">\n</span></span><!--[endif]-->Operating the software is more cumbersome than\nsome<span style=\"color:#5A5A5A\"><o:p></o:p></span></p>\n\n<p class=\"Factsbody\">I use CMAP myself when I\nwant to sort out my thinking on a complex subject.&nbsp; Though concept maps are similar to mind maps,\ntheir appearance and use is often different (see links in the introduction).</p>\n\n<p class=\"Body\">Cmap can show sentences implied by the concepts and their linking\nphrases. It supports making presentations.</p>\n\n<p class=\"Body\">You can use this as simple desktop mapping software or, using an\npublic on-line or intranet server, you can collaborate and share a map with\nothers.</p>\n\n<p class=\"Body\"><b>Collaboration support:</b>\n&nbsp;Multiple users can negotiate to edit the\nsame map simultaneously and Cmap supports chat while they edit.</p>"
                            }
